<?php $__env->startSection('content'); ?><p>She was a regular part of Keeping Up With The Kardashians from its debut in 2007 until her divorce from Kris Jenner in 2015 and her gender transition.</p>

<p>And as news broke that the E! reality series is coming to an end after 20 seasons, Caitlyn Jenner was seen on her daily Starbucks run in LA.</p>

<p>As of Tuesday night, the 70-year-old has not publicly commented on the demise of KUWTK which still stars her daughters Kendall and Kylie Jenner.</p>

<p>Pensive: Caitlyn Jenner, 70, looked to be deep in thought Tuesday as she picked up a drink in Malibu after news broke that Keeping Up With The Kardashians is ending after 20 seasons</p>

<p>The reality show was the brainchild of Caitlyn's ex Kris and TV host and producer Ryan Seacrest and followed the lives of Kris' family that included Caitlyn, then Bruce, along with Kendall and Kylie, and Kris' four children from her marriage to Robert Kardashian, Kourtney, Kim, Khloe and Rob.</p>

<p>At the beginning, it was Bruce who was the celebrity given his fame as a gold medalist in the decathlon at the 1976 Summer Olympics in Montreal, Canada.</p>

<p>But in the intervening 13 years, he has been eclipsed by the phenomenal popularity of the Kardashian-Jenner siblings who turned their family's fame into a multi-million dollar empire. </p>

<p>Caitlyn starred for two seasons on the spin-off I Am Cait in 2016 and has just launched her own YouTube channel.</p>

