<p>She shared a segment in which she, or Bruce as she was then, faced off over a haircut. </p>

<p>Bruce was seen with Kourtney and Khloe Kardashian at a hair styling session where the girls are encouraging him to get his hair cut while Bruce is reluctant because, he explains, he likes having a ponytail. </p>

<p>In the end he gets a little trim but when Kris arrives to see how it's going, she is not amused.</p>

